script: |
  super -f text -I q6854.spq | sort > q6854.out

inputs:
  - name: q6854.spq
    data: |
      SELECT 35 + + col0 * + col2 AS col1 FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT ( col1 * + col2 + col1 * - col1 ) NOT BETWEEN col1 + 68 AND - col1 - + col2;
  - name: tab0

outputs:
  - name: q6854.out
    data: |
